import { Colors } from "../ui/Colors";
import { Header1, Header2, Header3 } from "../ui/Layouts";
import styled from "styled-components";

const Container = styled.div`
display:flex
flex-direction:column
align-items:center
`;

export const MainScreen = () => {
  return (
    <Container>
      <p>Welcome to Voice Description!</p>
      <p>A more effective way to explain your task to others</p>
      <div></div>
      <p>Start recording now</p>
    </Container>
  );
};
